import React from 'react';
import { useNavigate } from 'react-router-dom';

const Home = () => {
    const navigate = useNavigate();
    const goToDogs = () => {
        navigate("/dogs"); 
    }
    return (
        <div>
            <h1>Good Luck!</h1>
            <button onClick={goToDogs}>To Dogs Page</button>
        </div>
    );
}

export default Home;
